Podemos lanza la campaña en busca de los indecisos

Incidirá en el mensaje de que ha llegado la hora de 'reconstruir' España
Podemos apuesta por aumentar el gasto público en 96.000 millones hasta 2019
Pablo Iglesias utiliza a sus grupos parlamentarios como la primera línea de campaña
Podemos tiene lema de campaña: 'Un país contigo'. Y, con él, también listo su discurso para el 20-D. El partido de Pablo Iglesias incidirá en el mensaje de que ha llegado la hora de "reconstruir" España con un nuevo "pacto de convivencia" que, ante todo, tenga un profundo carácter social para conseguir así un país "más justo, más unido y más fuerte". Para ello, Podemos apelará a los damnificados de la crisis y de las políticas del PP, a quienes promete impulsar una España "que no deje a nadie atrás". "Ése es nuestro modelo de patriotismo", ha destacado  Íñigo Errejón.
Quedan dos semanas para el inicio de la campaña electoral y en Podemos afinan y ponen a punto el mensaje con la premisa de que aún tienen un importante margen para recuperar el terreno perdido, porque las encuestas reflejan hasta un 22% de indecisos. A ellos precisamente se quiere dirigir durante las próximas semanas, y a los que se interpela expresamente en el lema (contigo) con un eslogan mucho más personal que el de pasadas elecciones, como las autonómicas de mayo, cuando buscó con Es ahora incidir en la oportunidad del momento. 
Para el 20-D, Podemos pretende encontrar la complicidad de los sectores de indecisos más castigados y con más ganas de un cambio. Como ha explicado el director de campaña, Íñigo Errejón, con el lema se quiere hacer "un guiño" a los "héroes" que en los años más duros se han apretado el cinturón o han tenido que hacer "milagros con los presupuestos familiares", recalcando que ha sido "sin el apoyo" de las instituciones y el gobierno.
Errejón ha señalado que "ahora toca rehacer ese acuerdo de convivencia" y "reconstruir" España de otra manera, sin olvidarse a nadie, porque en los últimos años se ha producido una "brecha" cada vez "más grande" entre "el país oficial y el país real", "entre la España de a pie y la España de corbata".
Con ello, Podemos recupera el discurso más genuino de su mejor etapa, cuando hace un año se disparó en las encuestas. Ahora, en cambio, la formación reconoce que tiene que buscar seducir a los indecisos y, para ello, Errejón ha prometido una campaña de "certezas" para atraer a quien todavía tiene dudas. En un momento dado, el director de campaña bromeó instando a "salir del armario" a quienes simpatizan con un cambio en España pero que todavía no tienen claro el partido.
Al margen del mensaje, Podemos va avanzado a cuentagotas algunos de los actos de la campaña. El partido hará la pegada de carteles la noche del 3 de diciembre fuera de Madrid y celebrará su primer acto al día siguiente en Cádiz, por ser la "cuna del constitucionalismo español".
A partir de ahí, Podemos tendrá una presencia más destacada en las comunidades de Madrid, Cataluña, Comunidad Valenciana, Andalucía, Galicia y Aragón, las autonomías que repartan el mayor número de escaños, y donde Pablo Iglesias concentrará la mayoría de sus esfuerzos. De hecho, dentro del partido asumen que será imposible que pueda estar en todas las comunidades autónomas. No obstante, recorrerá la mayoría durante las dos semanas de campaña.
El día 13, domingo, Podemos celebrará en el sur de Madrid el acto más importante de campaña, aunque todavía está por definir dónde. Sí se espera que sea un acto multitudinario. Asimismo, ya se conoce que la formación morada cerrará campaña en Valencia.
